    <div className="App">
      Kalkulator Oplat
      <input type="checkbox" id="mycheck" onClick={checkie}></input>
    <div className="container" >  
    Ilosc sprzedanego Alkoholu A
    <Calculat></Calculat>
     </div> 
     <div className="box "> 
     Ilosc sprzedanego Alkoholu B
      <Calculate></Calculate>
      </div>
      <div className="box-box">
      Ilosc sprzedanego Alkoholu C 
      <Calculatee></Calculatee>
      </div>
      </div>
      );
}
